Новий дизайн пристрою, панель керування з сенсорним екраном та LED підсвічуванням;
Завдяки дуже низьким рівням шуму, котел ecoTEC plus пропонує приємну атмосферу без дратівливих шумів, навіть якщо він встановлений поблизу житлових кімнат;
Істотно збільшена ефективність згоряння газу. Система IoniDetect постійно підлаштовує котел під конкретну якість газу, регулюючи співвідношення газ – повітря;
Функція асистенту з налаштувань та повноформатний текстовий дисплей дозволяють швидко і легко налаштувати котел при першому пуску та краще зрозуміти різні функції пристрою;
Можливість часових та температурних налаштуваннь безпосередньо на котлі;
Завдяки модулю VR 921, кінцевий користувач може отримати дистанційну сервісну підтримку від інсталятора, що дозволяє забезпечити швидке реагування;
Функції aquaPOWER plus, гарячий старт та «намилювання»;
Для виготовлення максимально використовуються матеріали, що підлягають переробці.
